import React from "react";

function Icon(props){
 return  (
    <div 
      style = {{color: props.color, cursor: "pointer"}}>
         <span className="my-tooltip">
            <i className ={props.typeIcon}></i>
            <span className="my-tooltiptext">{props.toolTipText}</span>
         </span>
    </div>);
};

<span className="my-tooltip">
<span className="my-tooltiptext">drag</span>
</span>

export default Icon;
